import React from "react";
import { Link } from "react-router-dom";
import "../../App.css";

const HeaderForm = () => {
  return (
    <div className="header">
      <div className="logo">로고</div>
      <div className="logout-button">
        <Link to="/logout">로그아웃</Link>
      </div>
    </div>
  );
};

export default HeaderForm;
